var Cons = function(){
    var self = this;
    self.data = [
        {id:0, code:'OFFLINE', des:"未上线"},
        {id:1, code:'ONLINE', des:"已上线"},
        {id:2, code:'EXPIRED', des:"已过期"}
    ];

    self.id = {};

    for(var i = 0; i < self.data.length; i++)
    {
        var set = self.data[i];
        self[set.code] = set;

        self.id[set.id] = set;
    }
};
module.exports = new Cons();

